import React, { useState } from 'react'
import {  Navigate, NavLink } from 'react-router-dom'
import './Register.css'
const Register = (props) => {

  const[name, setname]=useState()
  const[Email, setEmail]=useState()
  const[Password, setPassword]=useState()

  console.log(Email)
  console.log(Password)

  function HandleLogin (e){
    e.preventDefault();
    
    
    navigate("/posts");
  }
  return (
    <div className='logincontainer'>
    <div>
      <form className='formcontainer' onSubmit={HandleLogin}>
        <h2>Register</h2>
        <p>New user? <NavLink to='/signin'>Create account</NavLink></p>
        <input className='inputbox' placeholder='Username' onChange={(e)=>setname(e.target.value)}></input>
        <input className='inputbox' placeholder='email' onChange={(e)=>setEmail(e.target.value)}></input>
        <input className='inputbox' placeholder='password'onChange={(e)=>setPassword(e.target.value)}></input>
        <label><input type="checkbox" className='checkboxs' /><span className='checkboxtext'> keep me signed in</span></label>
        <button type='submit'>Sign in</button>
        <p className='textbottom'><span>or sign in with</span></p>
      </form>
    </div>

    <div className='imgcontainer'>
      <img className='picture' src={require('../Images/SignIn.png')} alt='loading'></img>
    </div>
  </div>
  )
}

export default Register
